import "./styles.css";

export const Manufacturer = () => {
    interface RESPONSE {
        status:string
        txid:string
      };

  return (
    <div>
      <h1>Manufacturer</h1>
      <div className="form">
        <input
          name="id"
          type="text"
          className="feedback-input"
          placeholder="Enter Product ID"
        />
        <button>Get</button>
      </div>

      <a href="/">Home</a>
    </div>
  );
};
